import Default from ".";

describe("two-sum", () => {
  it("case 1", () => {
    expect(
      Default(
        ""
      )
    ).toEqual("gykrkyg");
  });

  it("case 2", () => {
    expect(Default("a")).toEqual("a");
  });
  it("case 3", () => {
    expect(Default("aba")).toEqual("aba");
  });
  it("case 4", () => {
    expect(Default("babad")).toEqual("bab");
  });
  it("case 5", () => {
    expect(Default("cbbd")).toEqual("bb");
  });
  it("case 6", () => {
    expect(Default("ccc")).toEqual("ccc");
  });
});
